INSERT INTO `dsc_article` VALUES ('42', '14', '入驻流程', '<div class=\"sett-step\">\r\n<div class=\"item item1\">\r\n<div class=\"item-i\"><i></i></div>\r\n<span>1 阅读入驻需知</span>\r\n</div>\r\n<em class=\"item-jt\"></em>\r\n<div class=\"item item2\">\r\n<div class=\"item-i\"><i></i></div>\r\n<span>2 填写公司信息</span>\r\n</div>\r\n<em class=\"item-jt\"></em>\r\n<div class=\"item item3\">\r\n<div class=\"item-i\"><i></i></div>\r\n<span>3 填写店铺信息</span>\r\n</div>\r\n<em class=\"item-jt\"></em>\r\n<div class=\"item item4\">\r\n<div class=\"item-i\"><i></i></div>\r\n<span>4 等待审核</span>\r\n</div>\r\n</div>\r\n<div class=\"temp\">\r\n    <div class=\"mt\">\r\n        <h3>\r\n            招商会预告\r\n        </h3>\r\n    </div>\r\n    <div class=\"mc\">\r\n        <div class=\"title\">\r\n            商创POP开放平台招商大会（上海站）\r\n        </div>\r\n        <div class=\"content\">\r\n            <p>\r\n                我司将于2014年4月23日下午14点-17点在杭州举办&quot;商创POP开放平台招商大会（杭州站）&quot;，主要针对服饰内衣类目下：女装、男装、内衣、服饰配件、鞋靴、珠宝首饰等商家，希望各地有意加入商创电子商务的企业光临本次大会，我们将在此与您分享商创商城集团的广阔前景，共创美好未来！如您有意向参加请联系我们报名。请您参会前携带打印或电子件邀请函1份、名片（2张/人）。（每个商家最多限两人参会）\r\n            </p>\r\n            <p>\r\n                <strong>一：举办时间</strong>\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n            </p>\r\n            <p>\r\n                　　2014年4月23日下午14点-17点\r\n            </p>\r\n            <p>\r\n                <strong>二：报名方式：</strong>\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n            </p>\r\n            <p>\r\n                　　张经理：111@1234.com ，13512342334，QQ123456；\r\n            </p>\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"temp\">\r\n    <div class=\"mt\">\r\n        <h3>\r\n            线下入驻流程\r\n        </h3>\r\n    </div>\r\n    <div class=\"mc\">\r\n        <div class=\"steps\">\r\n            <div class=\"s-title\">\r\n                1&nbsp;申请入驻\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n            </div>\r\n            <div class=\"s-con\">\r\n                <p>\r\n                    <strong>核对资质信息：</strong>商家首先关注商创商城入驻标准，确认符合要求\r\n                </p>\r\n                <p>\r\n                    <strong>提交入驻申请：</strong>商家务必按照邮件要求将信息发送到各类目负责人邮箱\r\n                </p>\r\n                <p>\r\n                    <strong>双方沟通：</strong>收到资料后，商创招商负责人会第一时间与您取得联系\r\n                </p>\r\n                <p>\r\n                    <strong>确认合作意向：</strong>招商负责人会与您就合作条款、要求进行沟通，双方确认合作意向\r\n                </p>\r\n            </div>\r\n        </div>\r\n        <div class=\"steps\">\r\n            <div class=\"s-title\">\r\n                2&nbsp;签订合同\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n            </div>\r\n            <div style=\"padding-top: 30px;\" class=\"s-con\">\r\n                <p>\r\n                    <strong>发送合同：</strong>招商负责人邮寄合同到商家处\r\n                </p>\r\n                <p>\r\n                    <strong>资质合同审核：</strong>商家按照要求签订合同、提交资质文件到商创\r\n                </p>\r\n                <p>\r\n                    <strong>资质合同审核：</strong>商创相关部门审核合同与资质文件\r\n                </p>\r\n            </div>\r\n        </div>\r\n        <div class=\"steps last\">\r\n            <div class=\"s-title\">\r\n                3&nbsp;开店准备\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n            </div>\r\n            <div style=\"padding-top: 30px;\" class=\"s-con\">\r\n                <p>\r\n                    <strong>准备产品资料：</strong>商家准备需要合作产品的相关图片及说明\r\n                </p>\r\n                <p>\r\n                    <strong>交纳相关费用：</strong>商家交纳保证金和平台使用费\r\n                </p>\r\n                <p>\r\n                    <strong>开店销售：</strong>产品运营经理将与您取得联系安排开店事宜\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"temp\">\r\n    <div class=\"mt\">\r\n        <h3>\r\n            入驻指南\r\n        </h3>\r\n    </div>\r\n    <div class=\"mc guige\">\r\n        <dl>\r\n            <dt>\r\n                资金要求：\r\n            </dt>\r\n            <dd>\r\n                公司注册资金50万及50万以上人民币；\r\n            </dd>\r\n        </dl>\r\n        <dl>\r\n            <dt>\r\n                授权资质：\r\n            </dt>\r\n            <dd>\r\n                需要确保授权链条的完整，即申请入驻企业拿到的授权能够逐级逆推回品牌商；\r\n            </dd>\r\n        </dl>\r\n        <dl>\r\n            <dt>\r\n                提供发票：\r\n            </dt>\r\n            <dd>\r\n                所有入驻的企业必须给消费者提供正规发票，发票盖章的公司名称必须与商家与商创合作的公司名称一致；\r\n            </dd>\r\n        </dl>\r\n        <dl>\r\n            <dt>\r\n                申请类型：\r\n            </dt>\r\n            <dd>\r\n                商创商城暂不接受未取得国家商标总局颁发的商标注册证或商标受理通知书的境外品牌的开店申请；\r\n            </dd>\r\n        </dl>\r\n        <dl>\r\n            <dt>\r\n                真实有效：\r\n            </dt>\r\n            <dd>\r\n                请务必保证您入驻前后提供的相关资质的真实有效性（若您提供的相关资质为第三方提供，如商标注册证、授权书等，请务必先行核实其真实有效性），一旦发现虚假资质，您的公司将被列入非诚信商家名单，商创商城将不再与您进行合作，并将扣除保证金。\r\n            </dd>\r\n        </dl>\r\n    </div>\r\n</div>', 'ecmoban', 'ecmoban@qq.com', 'ecmoban', '1', '1', '1399147117', '', '0', 'http://', 'ecmoban');
