INSERT INTO `dsc_article` VALUES ('47', '14', '入驻帮助', '<div class=\"sett-help-warp s-section-help\">\r\n<div class=\"item\">\r\n<div class=\"number\">01</div>\r\n<div class=\"info\">\r\n<div class=\"name\">\r\n<div class=\"tit\"><a href=\"#\">在线填写入驻信息，关闭或者退出页面时是否可以自动保存？</a></div>\r\n<div class=\"desc\">商家每次在点击下一步后，系统都会自动保存上一步已经填写的内容，关闭或者退出页面后，下次用同样的用户名和密码登陆，都会自动跳转到上次填写的那一个步骤，上传的资质文件系统会自动保存。</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"item\">\r\n<div class=\"number\">02</div>\r\n<div class=\"info\">\r\n<div class=\"name\">\r\n<div class=\"tit\"><a href=\"#\">如果注册账号已在国美在线开通过店铺，能否使用同一注册账号在卖家入驻系统再次新开店铺？</a></div>\r\n<div class=\"desc\">商家每次在点击下一步后，系统都会自动保存上一步已经填写的内容，关闭或者退出页面后，下次用同样的用户名和密码登陆，都会自动跳转到上次填写的那一个步骤，上传的资质文件系统会自动保存。</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"item\">\r\n<div class=\"number\">03</div>\r\n<div class=\"info\">\r\n<div class=\"name\">\r\n<div class=\"tit\"><a href=\"#\">如何申请入驻商创？</a></div>\r\n<div class=\"desc\">商家每次在点击下一步后，系统都会自动保存上一步已经填写的内容，关闭或者退出页面后，下次用同样的用户名和密码登陆，都会自动跳转到上次填写的那一个步骤，上传的资质文件系统会自动保存。</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"item\">\r\n<div class=\"number\">04</div>\r\n<div class=\"info\">\r\n<div class=\"name\">\r\n<div class=\"tit\"><a href=\"#\">如何申请入驻商创？</a></div>\r\n<div class=\"desc\">申请路径：进入点击【招商页面】-【立即入驻】。点击查看招商标准；点击查看招商品牌</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"item\">\r\n<div class=\"number\">05</div>\r\n<div class=\"info\">\r\n<div class=\"name\">\r\n<div class=\"tit\"><a href=\"#\">如何申请入驻商创？</a></div>\r\n<div class=\"desc\">申请路径：进入点击【招商页面】-【立即入驻】。点击查看招商标准；点击查看招商品牌</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"item\">\r\n<div class=\"number\">06</div>\r\n<div class=\"info\">\r\n<div class=\"name\">\r\n<div class=\"tit\"><a href=\"#\">如何申请入驻商创？</a></div>\r\n<div class=\"desc\">商家每次在点击下一步后，系统都会自动保存上一步已经填写的内容，关闭或者退出页面后，下次用同样的用户名和密码登陆，都会自动跳转到上次填写的那一个步骤，上传的资质文件系统会自动保存。</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'ecmoban', 'ecmoban@qq.com', 'ecmoban', '0', '1', '1399151063', '', '0', 'http://', 'ecmoban');
