PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px\"><p style=\"PADDING-BOTTOM: 0px; LINE-HEIGHT: 21px; MARGIN-TOP: 0px; TEXT-INDENT: 2em; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; MARGIN-BOTTOM: 20px; PADDING-TOP: 0px\"><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: 宋体, SimSun; PADDING-TOP: 0px\"><strong style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; COLOR: rgb(204,0,0); PADDING-TOP: 0px\">3.</strong><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px\">&nbsp;钱、货需客户当面点清，离开提货前台后将不再对钱、货数量负责；</span></span> &nbsp; &nbsp; &nbsp; &nbsp;</p></li><li style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px\"><p style=\"PADDING-BOTTOM: 0px; LINE-HEIGHT: 21px; MARGIN-TOP: 0px; TEXT-INDENT: 2em; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; MARGIN-BOTTOM: 20px; PADDING-TOP: 0px\"><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: 宋体, SimSun; PADDING-TOP: 0px\"><strong style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; COLOR: rgb(204,0,0); PADDING-TOP: 0px\">4.</strong>&nbsp;<span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px\">货物价保需客户在自提当场提出，离开提货前台后不再对自提货物提供价保服务；</span></span> &nbsp; &nbsp; &nbsp; &nbsp;</p></li><li style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px\"><p style=\"PADDING-BOTTOM: 0px; LINE-HEIGHT: 21px; MARGIN-TOP: 0px; TEXT-INDENT: 2em; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; MARGIN-BOTTOM: 20px; PADDING-TOP: 0px\"><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: 宋体, SimSun; PADDING-TOP: 0px\"><strong style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; COLOR: rgb(204,0,0); PADDING-TOP: 0px\">5.</strong>&nbsp;<span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px\">普通发票：由库房开具发票，随包裹一同发送，自提点不提供开票和换票服务。</span></span> &nbsp; &nbsp; &nbsp; &nbsp;</p></li></ul><p><strong>注意事项</strong></p><ul style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px\"><p style=\"PADDING-BOTTOM: 0px; LINE-HEIGHT: 21px; MARGIN-TOP: 0px; TEXT-INDENT: 2em; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; MARGIN-BOTTOM: 20px; PADDING-TOP: 0px\"><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: 宋体, SimSun; PADDING-TOP: 0px\"><strong style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; COLOR: rgb(204,0,0); PADDING-TOP: 0px\">1.</strong>&nbsp;<span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px\">如果一个ID账号在一个月内有过1次以上或一年内有过3次以上，在规定的时间内因客户原因不履约提货，我司将在相应的ID账户里每单扣除50积分（或500京豆）作为运费；时间计算方法为：成功提交订单后向前推算30天为一个月，成功提交订单后向前推算365天为一年，不以自然月和自然年计算；</span></span> &nbsp; &nbsp; &nbsp; &nbsp;</p></li><li style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px\"><p style=\"PADDING-BOTTOM: 0px; LINE-HEIGHT: 21px; MARGIN-TOP: 0px; TEXT-INDENT: 2em; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; MARGIN-BOTTOM: 20px; PADDING-TOP: 0px\"><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-FAMILY: 宋体, SimSun; PADDING-TOP: 0px\"><strong style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; COLOR: rgb(204,0,0); PADDING-TOP: 0px\">2.</strong>&nbsp;<span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px\">对于上门自提的客户，我司可以接受现金、pos机刷卡和支票支付<span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; COLOR: red; PADDING-TOP: 0px\" class=\"Red\">（<span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; PADDING-TOP: 0px\">支票支持北京、上海、广州、成都、武汉、沈阳六大城市</span>）</span>。选择支票支付方式，需要客户自行将支票内容填写完整（除广州不分金额一律到账后提货，其他城市货款5000元以下可先提货，5000元及以上必须款到帐后方可提货）；POS机刷卡只支持带有银联标识的银行卡；</span></span> &nbsp; &nbsp; &nbsp; &nbsp;</p></li></ul><p><br/></p>', 'sunle', '', '', '0', '1', '1450226733', '', '0', 'http://', '');
INSERT INTO `dsc_article` VALUES ('57', '14', '入驻协议', '<div class=\"item\">\r\n<h2>\r\n1.本协议的订立\r\n</h2>\r\n<p class=\"cont\">\r\n在本网站（<a target=\"_blank\" href=\"http://www.ecmoban.com/\" class=\"link\">www.ecmoban.com</a>）依据《商创商城网站用户注册协议》登记注册，且符合本网站\r\n\r\n商家入驻标准(详见链接：<a target=\"_blank\" href=\"http://www.ecmoban.com/contact/joinin.aspx\" class=\"link\">http://www.ecmoban.com/contact/joinin.aspx</a>）的用户（以下简称&quot;商\r\n\r\n家&quot;），在同意本协议全部条款后，方有资格使用&quot;商创商城商家在线入驻系统&quot;（以\r\n\r\n下简称&quot;入驻系统&quot;）申请入驻。一经商家点击&quot;同意以上协议，下一步&quot;按键，\r\n\r\n即意味着商家同意与本网站签订本协议并同意受本协议约束。\r\n</p>\r\n</div>\r\n<div class=\"item\">\r\n<h2>\r\n2.入驻系统使用说明\r\n</h2>\r\n<p class=\"cont\">\r\n2.1 商家通过入驻系统提出入驻申请，并按照要求填写商家信息、提供商家资质资料后，由\r\n\r\n本网站审核并与有合作意向的商家联系协商合作相关事宜，经双方协商一致线下签订书面《开放平台\r\n\r\n供应商合作运营协议》（以下简称&quot;运营协议&quot;），且商家按照&quot;运营协议&quot;约定\r\n\r\n支付相应平台使用费及保证金等必要费用后，商家正式入驻本网站。本网站将为入驻商家开通商家后\r\n\r\n台系统，商家可通过商家后台系统在本网站运营\r\n\r\n自己的入驻店铺。\r\n</p>\r\n<p class=\"cont\">\r\n2.2 商家以及本网站通过入驻系统做出的申请、资料提交及确认等各类沟通，仅为双方合作\r\n\r\n的意向以及本网站对商家资格审核的必备程序，除遵守本协议各项约定外，对双方不产生法律约束力\r\n\r\n。双方间最终合作事宜及运营规则均以&quot;运营协议&quot;的约定及商家后台系统公示的各项规则\r\n\r\n为准。\r\n</p>\r\n</div>\r\n<div class=\"item\">\r\n<h2>\r\n3.商家权利义务\r\n</h2>\r\n<p>\r\n用户使用&quot;商创商城商家在线入驻系统&quot;前请认真阅读并理解本协议内容，本协议\r\n\r\n内容中以加粗方式显著标识的条款，请用户着重阅读、慎重考虑。\r\n</p>\r\n</div>\r\n<div class=\"item\">\r\n<h2>\r\n1.本协议的订立\r\n</h2>\r\n<p class=\"cont\">\r\n在本网站（<a target=\"_blank\" href=\"http://www.ecmoban.com\" class=\"link\">www.ecmoban.com</a>）依据《商创商城网站用户注册协议》登记注册，且符合本网站\r\n\r\n商家入驻标准(详见链接：<a target=\"_blank\" href=\"http://www.ecmoban.com/contact/joinin.aspx\" class=\"link\">http://www.ecmoban.com/contact/joinin.aspx</a>）的用户（以下简称&quot;商\r\n\r\n家&quot;），在同意本协议全部条款后，方有资格使用&quot;商创商城商家在线入驻系统&quot;（以\r\n\r\n下简称&quot;入驻系统&quot;） 申请入驻。一经商家点击&quot;同意以上协议，下一步&quot;按键\r\n\r\n，即意味着商家同意与本网站签订本协议并同意受本协议约束。\r\n</p>\r\n</div>\r\n<div class=\"item\">\r\n<h2>\r\n2.入驻系统使用说明\r\n</h2>\r\n<p class=\"cont\">\r\n2.1 商家通过入驻系统提出入驻申请，并按照要求填写商家信息、提供商家资质资料后，由\r\n\r\n本网站审核并