INSERT INTO `dsc_article` VALUES ('64', '14', '了解更多', '<div class=\"sett-store-warp\">\r\n<div class=\"item\">\r\n<div class=\"item-left\">\r\n<i class=\"st-icon1\"></i>\r\n<span>旗舰店</span>\r\n</div>\r\n<div class=\"item-right\">商家以企业自有品牌(商标为R或TM)入驻美丽说（商家代理品牌，品牌授权书需要注明此公司拥有独占授权）</div>\r\n</div>\r\n<div class=\"item\">\r\n<div class=\"item-left\">\r\n<i class=\"st-icon2\"></i>\r\n<span>专营店</span>\r\n</div>\r\n<div class=\"item-right\">经营两个及以上他人或自有品牌商品的专营店，既经营他人品牌商品又经营自有品牌商品的专营店</div>\r\n</div>\r\n<div class=\"item\">\r\n<div class=\"item-left\">\r\n<i class=\"st-icon3\"></i>\r\n<span>专卖店</span>\r\n</div>\r\n<div class=\"item-right\">商家持有他人授权，并且经营单一品牌的专卖店</div>\r\n</div>\r\n</div>\r\n<div class=\"s-wz-content\">\r\n<div class=\"tempItem\">\r\n<h3>\r\n招商方向\r\n</h3>\r\n<div class=\"content\">\r\n<p>\r\n1.品牌<br/>国内外知名品牌国美在线开放平台将一如既往的最大程度地维护卖家的品牌利益，尊重品牌传统和内涵，欢迎优质品牌旗舰店入驻，请参见《2015年国美在线开放平台热招品牌》。\r\n</p>\r\n<p>\r\n2.商品<br/>能够满足国美在线买家需要的优质、特色的商品。<br/>根据类目结构细分的商品配置。类目招商咨询详见《国美在线开放平台各类目联系方式》。\r\n</p>\r\n<p>\r\n3.垂直电商网站<br/>垂直类电商网站针对某一特定行业或者细分市场，面向特定人群和特定需求，开展，例如箱包奢品、汽车用品、食品酒水、运动户外等等。<br/>国美在线开放平台欢迎垂直类电商入驻。国美在线开放平台愿意和专业的垂直电商企业分享其优质用户群体，并且欢迎垂直电商为国美在线用户提供该领域专业的商品及服务。\r\n</p>\r\n</div>\r\n</div>\r\n<div class=\"tempItem\">\r\n<h3>\r\n资费标准\r\n</h3>\r\n<div class=\"content\">\r\n<p>\r\n1.保证金：卖家向国美在线缴纳的用以保证店铺规范运营及对商品和服务质量进行担保的金额。当卖家发生违约、违规行为时，国美在线可以依照与卖家签署的协议中相关约定及国美在线开放平台规则扣除相应金额的保证金作为违约金或给予买家的赔偿。续约商家须在当年续签要求的时间内一次性缴纳次年度保证金；新签商家在申请入驻获得批准时一次性缴纳当年度的保证金。\r\n</p>\r\n<p>\r\n2.平台使用费：卖家依照与国美在线签署的相关协议使用国美在线开放平台各项服务时缴纳的固定技术服务费用。\r\n</p>\r\n<p>\r\n3.技术服务费：卖家根据经营类目在达成每一单交易时按比例（该比例在与卖家签署的相关协议中称为“技术服务费费率”或“毛利保证率”）向国美在线缴纳的费用。\r\n</p>\r\n</div>\r\n</div>\r\n<div class=\"tempItem\">\r\n<h3>\r\n联系方式\r\n</h3>\r\n<div class=\"content\">\r\n<p>\r\n供应商：公司名称，如“供应商：XX公司”<br/>发送方式：根据经营的产品找到相应的类目负责人，发送邮件。\r\n</p>\r\n<p>\r\n邮件内容：\r\n</p>\r\n<p class=\"ml10\">\r\n1、详细信息（联系人，联系地址，联系电话）\r\n</p>\r\n<p class=\"ml10\">\r\n2、公司简介（公司简介、公司网址、注册资本、供应商级别（厂商、国代、一级代理、二级代理、其他）、所销售品。）\r\n</p>\r\n<p class=\"ml10\">\r\n3、是否能开增值税发票。\r\n</p>\r\n<p class=\"mt20\">\r\n注：您的每一封邮件我们都会详细审阅，并在2个工作日内给予答复。如果超出2个工作日未收到答复或者招商进程遇到人为阻碍、拖延的情况，可反馈至“feedback@jd.com”邮箱。业务层面的问题请直接与类目负责人联系。\r\n</p>\r\n</div>\r\n</div>\r\n</div>', '', '', '', '0', '1', '1490844051', '', '0', 'http://', '');
